import { BrowserRouter,Routes,Route, Navigate ,Link ,Outlet } from 'react-router-dom';
import { Grid ,Item ,Container } from 'semantic-ui-react';

import Member from './pages/Member';
import Header from './Header';
import Signin from './pages/Signin';
import Posts from './pages/Posts';
import Analyze from './pages/Analyze';
import AnalyzeResult from './pages/AnalyzeResult';
import Handsome from './pages/Handsome';


function App(){
    return(
    <BrowserRouter>
        <Header />
        <Routes>
            <Route path='/' element={<Posts/>}></Route>
            <Route path='/signin' element={<Signin />}></Route>

            <Route 
                path='/analyze'
                element={<Analyze />}
            >
            </Route>
            <Route path='/my' element={<Member />}>
                <Route element={"嗨"} path='/my/history'></Route>
                <Route element={"你好"} path='/my/settings'></Route>
            </Route>
            <Route 
                path='/analyzeResult'
                element={<AnalyzeResult />}
            >
            </Route>
            <Route 
                path='/handsome'
                element={<Handsome />}
            >
            </Route>
        </Routes>
    </BrowserRouter> 
    );
}

export default App
